                    <img src={member.avatar} />

                    <div className="colum">
                        <div className="panel-flex">
                            <h3>{member.username}</h3>
                            <p>{member.id}</p>
                        </div>

                        <div className="panel-flex">
                            <h3>Joined</h3>
                            <p>{member.joined}</p>
                        </div>

                        <div className="panel-flex">
                            <h3>Created</h3>
                            <p>{member.created}</p>
                        </div>
                    </div>

                </div>
            </div>
            <div className="center">

                <div className="panel-info-container">
                    <div className="panel-info-box">
